import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch} from "react-router-dom";
import CurrencyConverter from './CurrencyConverter';
import ExchangeRates from './ExchangeRates';
import { FaTwitter } from 'react-icons/fa';

const NotFound = () => {
  return <h2>404 Not Found</h2>;
}

const App = () => {
  return (
    <Router>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Link className="navbar-brand" to="/">Currency Converter</Link>
      </nav>

      <Route path="/" exact component={ CurrencyConverter } />
      <Route path="/" component={ ExchangeRates } />
      <Route component={NotFound} />
      <footer className="text-center text-lg-start bg-light">
       <h4><FaTwitter />www.twitter.com</h4> 
      </footer>
    </Router>
  );
}



export default App;
